DECLARE DEL_ONERROR NUMBER := $$ENABLE_DEL_ONERROR\;
BEGIN
IF DEL_ONERROR = 1 THEN
DELETE FROM MKT.TBMK2_MOVIMENTI_POSI_CAMS_DD
WHERE DT_INS BETWEEN TO_DATE('$$P_DT_INF','YYYY-MM-DD HH24:MI:SS') AND TO_DATE('$$P_DT_SUP','YYYY-MM-DD HH24:MI:SS') $$ENABLE_DEL_TBMK2_MOV_CAMS
 \;
COMMIT\;
END IF\;
END\;

